import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter,Route,Routes,Router,Switch} from 'react-router-dom';
import './index.css';
import App from './App';

ReactDOM.render(
  <Router>
  <Switch>
      <Route path="/" element={App}></Route>
  </Switch>
  </Router>,
  document.getElementById('root')
);
